import './App.css';
import { Route, Switch } from 'react-router';
import Home from './pages/home/Home'
import Search from './pages/search'

function App() {
  return (
    <Switch>
      <Route exact path='/'><Home/></Route>
      <Route path='/search'><Home/></Route>
      <Route path='/test'><Banner/></Route>
    </Switch>
  );
}

export default App;
